script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT DISTINCT - cor0.col1 * cor0.col0 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab1
  - name: tab2

outputs:
  - name: q9660.out
    data: |
      -1040
      -640
      -78
